function Footer() {
  return (
    <nav className="Footer">
      <ul>
        <li>
          <a href="https://www.linkedin.com/in/ana-marcos-est%C3%A9vez-7ab986232/"></a>
        </li>
      </ul>
    </nav>
  );
}

